br.script:
$(document).ready(function() {
    var isBuyerWithIncompleteProfileInfo = false;
    if (isBuyerWithIncompleteProfileInfo) openAddressModal();
    addListiners();
});

function addListiners() {
    var addressInputs = document.getElementsByClassName('address-input');

    for (i = 0; i < addressInputs.length; i++) {
        addressInputs[i].addEventListener('change', function (e) {
            setTimeout(enableSubmit, 1000);
        });
    }
}

function openAddressModal() {
    $('#updateAddressModal').modal('show');
    var country = document.getElementById("country").value;
    loadCountry(country);
    loadOutputs('errZipMsg', null, 'raddress', 'rcity', 'rstate', 'errZipMsg' );
    loadCityInput('addAddressBtn', null, 'cityContainerDiv', 'citySelectorDiv',  'streetAddress', 'city', 'state', 'zip', 'address-input form-control');
    $('#state').addClass("address-input");
    $("#titleShipName").hide();
    $("#selCountry").hide();
    $("#iCountry").show();
    $("#name").removeAttr("required");
    enableSubmit();
}

var req = null;
function checkZip() {
    if (req != null) {
        return;
    }
    zip = document.getElementById("zip").value;
    var country = document.getElementById("country").value;

    document.getElementById('errZipMsg').innerHTML = '';

    if (country == "" || (country != "USA" && country != "CAN")) {
        return;
    }

    if (country == "CAN") {
        document.getElementById("zip").value=isValidCANPCode(zip) ? formatCANPCode(zip) : zip;
    }
    if(country == "USA" || country == "CAN" || country == "MEX"){
        getCitiesByZip();
    } else {
        var url = '/jsp/acct/verify-zip.jsp?country=' + country +'&zip=' + zip;

        if (window.XMLHttpRequest) {
            req = new XMLHttpRequest();
        } else if (window.ActiveXObject) {
            req = new ActiveXObject("Microsoft.XMLHTTP");
        }

        req.onreadystatechange = updateCityState;
        req.open("POST", url , true);
        req.send("");
    }
    enableSubmit();
}
function updateCityState() {
    var retInfo = null;
    var state = null;
    var city = null;

    if (req == null || req.readyState != 4)
        return;

    if (req.status == 200) {
        var zipInfo = req.responseXML;
        if (zipInfo != null) {
            retInfo = zipInfo.getElementsByTagName("retInfo")[0].firstChild.nodeValue;

            if (retInfo == "ERROR") {

                document.getElementById("errZipMsg").innerHTML = '   '+'Postal code does not exist in '+ document.getElementById("country").value +'' + '';
                req = null;
                return;
            }

            var rcity, rstate, theCity;
            if (rstate = document.getElementById('rstate')) rstate.innerHTML = '';
            if (rcity = document.getElementById('rcity')) rcity.innerHTML = '';

            state = zipInfo.getElementsByTagName("state")[0].firstChild.nodeValue;
            city = zipInfo.getElementsByTagName("city")[0].firstChild.nodeValue;

            if (document.getElementById("state").value == "0" || document.getElementById("state").value == "") {
                document.getElementById("state").value = state;
            } else if (document.getElementById("state").value != state) {

                rstate.innerHTML = 'State should be ' + state + ' for ' + zipCode + ' ';
            }

            theCity = (document.getElementById("city").value.replace(/^\s+/,'')).replace(/\s+$/,'');
            if ("" == theCity) {
                document.getElementById("city").value = city;
            } else if (theCity.toLowerCase() != city.toLowerCase()) {

                rcity.innerHTML = 'City should be ' + city + ' for ' + zipCode + ' ';
            }
        }
    } else {
        document.getElementById("errZipMsg").innerHTML = '  '+'Invalid postal code'+'';
    }

    req = null;
}

body.script:
let trusteConsentTrackTask = undefined;
let timeoutForTrusteConsentTrackTask = undefined;

let teConsentTask = undefined;
let timeoutForTeConsentTask = undefined;

let checkFooterOrNATask = undefined;
let timeoutForFooterOrNACheckTask = undefined;

$(document).ready(function () {
    trusteConsentTrackTask = setInterval(updateTrusteConsentTrack, 100);

    timeoutForTrusteConsentTrackTask = setTimeout(function() {
        clearInterval(trusteConsentTrackTask);
    }, 5000);

    checkFooterOrNATask = setInterval(checkCCMFooter, 100);
    timeoutForFooterOrNACheckTask = setTimeout(function () {
        clearInterval(checkFooterOrNATask);
    }, 5000);
});

function updateTrusteConsentTrack() {
    if ($('#truste-consent-track').children() && $('#truste-consent-track').children().length > 0 && $('#truste-consent-track').css('max-width')) {
        $('#truste-consent-track').css('max-width', 'none');
        clearInterval(trusteConsentTrackTask);
        clearTimeout(timeoutForTrusteConsentTrackTask);
    }
}

function removeCookieMgmtLink() {
    if ($('#teconsent a')) {
        $('#teconsent a').css('display', 'none');
        clearInterval(teConsentTask);
        clearTimeout(timeoutForTeConsentTask);
    }
}

function checkCCMFooter() {
    if ($('div>#trustarc_ccm_id>a').length > 0) {
        clearInterval(checkFooterOrNATask)
        clearInterval(timeoutForFooterOrNACheckTask);
        //if CCM exists in footer, hide link
        teConsentTask = setInterval(removeCookieMgmtLink, 100);
        timeoutForTeConsentTask = setTimeout(function() {
            clearInterval(teConsentTask);
        }, 5000);
    }
}

$(function() {
    var acc = document.getElementsByClassName("footer-accordion");
    for (var i = 0; i < acc.length; i++) {
        acc[i].onclick = function () {
            this.classList.toggle("active");
            var panel = this.nextElementSibling;
            this.querySelector("i").classList.toggle("icon-plus");
            this.querySelector("i").classList.toggle("icon-minus");
            if (panel.style.maxHeight) {
                panel.style.maxHeight = null;
            } else {
                panel.style.maxHeight = panel.scrollHeight + "px";
            }
        }
    }
});

  $(function() {
	  if ($(window).scrollTop() == 0) {
		  $('ul.scroll-top').hide();
	  }
	  $(window).scroll(function () {
		  if ($(window).scrollTop() == 0) {
			  $('ul.scroll-top').fadeOut();
		  }
		  else {
			  $('ul.scroll-top').fadeIn();
		  }

	  });
	  /* scrolling for scroll to top */
	  $('.scroll-top').click(function () {
		  $('body,html').animate({scrollTop: 0}, 1000);
		  return false;
	  });
  });

var needsGoogtrans = Boolean(getCookie('googtrans') || (window.location.hash && window.location.hash.indexOf('googtrans') >= 0) || (getCookie('al') && getCookie('al') !== 'false'));
if(!getCookie('gtAuto')) {
	document.cookie= "gtAuto=0; expires=0; path=/";

	if(!getCookie('googtrans')) {
		var googtransP = getCookie('googtransP');
		if(!googtransP && getCookie('al') && getCookie('al') !== 'false') {
			setCookie('googtransP','/en/'+getCookie('al'));
			setCookie('googtrans','/en/'+getCookie('al'));
			needsGoogtrans = true;
		} else if(googtransP && googtransP !== 'none') {
			setCookie('googtrans',googtransP);
			needsGoogtrans = true;
		}
	} else {
		setCookie('googtransP',getCookie('googtrans'));
	}
}

$(window).on("unload", function() {
  var googtransP = getCookie('googtrans');
  setCookie('googtransP', googtransP ? googtransP : 'none');
});

function googleTranslateElementInit() {
